('', 'Ashbringer. The Arbiter\'s judgment is infallible. She must have recognized something within you that was meant for Maldraxxus.', 194007, 0, 0, 1, 0, 0, 0, 0, 164820, 0, 0, 0, 0, 0, 0, 45114),
('', 'Walk with me. Both of you.', 194543, 0, 0, 1, 0, 0, 0, 0, 164821, 0, 0, 0, 0, 0, 0, 45114),
('Yet I dedicated my life in service to the Light. Is that not what earns a place in Bastion?', '', 194010, 0, 0, 6, 0, 0, 0, 165437, 0, 0, 0, 0, 0, 0, 0, 45114),
('', 'With the Maldraxxi gone, Courage can regain its strength. My kin will be hungry for vengeance against the constructs.', 193020, 0, 0, 1, 0, 0, 0, 0, 164818, 0, 0, 0, 0, 0, 0, 45114),
('And they shall have it. But assaulting the House of Constucts is no mean task. We need time to prepare our forces.', '', 193021, 0, 0, 66, 0, 0, 0, 165436, 0, 0, 0, 0, 0, 0, 0, 45114),
('The Constructs are nothing if not persistent. But I swear to the Light that we will purge them from Bastion.', '', 193147, 0, 0, 1, 0, 0, 0, 165435, 0, 0, 0, 0, 0, 0, 0, 45114),
('', 'At last, the darkness clears from my temple... Yet, I feel it will not be absent long without action.', 193146, 0, 0, 1, 0, 0, 0, 0, 164816, 0, 0, 0, 0, 0, 0, 45114),
('', 'You... will never... win...', 192562, 0, 0, 1, 0, 0, 0, 0, 153912, 0, 0, 0, 0, 0, 0, 45114),
('', 'All of Bastion will be ours!', 192561, 0, 0, 0, 0, 0, 0, 0, 153911, 0, 0, 0, 0, 0, 0, 45114),
('', 'Enough of your meddling! Face me, so that I might crush you once and for all!', 193254, 0, 0, 1, 0, 0, 0, 0, 153913, 0, 0, 0, 0, 0, 0, 45114),
('', 'Coward! I will rip your carcass from my temple and cast it into oblivion!', 193256, 0, 0, 1, 0, 0, 0, 0, 164819, 0, 0, 0, 0, 0, 0, 45114),
('', 'We have but one enemy left to slay. Speak to me when you are prepared.', 193320, 0, 0, 1, 0, 0, 0, 0, 164817, 0, 0, 0, 0, 0, 0, 45114),
('', 'Let the rain of justice cleanse this ground!', 192957, 0, 0, 1, 0, 0, 0, 0, 164815, 0, 0, 0, 0, 0, 0, 45114),
('', 'Mark my targets, Maldraxxi. I will smite them with haste!', 195205, 0, 0, 1, 0, 0, 0, 0, 164813, 0, 0, 0, 0, 0, 0, 45114),
('', 'On me, Maldraxxi! Together, we will cleanse this temple.', 193307, 0, 0, 1, 0, 0, 0, 0, 164814, 0, 0, 0, 0, 0, 0, 45114),
('Too... soon...', 'Too... soon...', 190972, 0, 0, 0, 0, 0, 15, 152376, 152377, 0, 0, 0, 0, 0, 0, 45114),
('', 'Pathetic little weaklings! You cannot stop the House of Constructs!', 193886, 0, 0, 1, 0, 0, 0, 0, 164540, 0, 0, 0, 0, 0, 0, 45114),
('', 'The skies clear! Regroup with me on the western landing, Maldraxxi. Retribution is at hand.', 193143, 0, 0, 1, 0, 0, 0, 0, 164812, 0, 0, 0, 0, 0, 0, 45114),
('The kyrian will fall!', '', 193140, 0, 0, 0, 0, 0, 0, 166157, 0, 0, 0, 0, 0, 0, 0, 45114),
('Yet you cower in your necropolis! I will silence your boasting with a single strike!', '', 195412, 0, 0, 1, 0, 0, 0, 165434, 0, 0, 0, 0, 0, 0, 0, 45114),
('', 'You rush headlong to your demise! I look forward to tearing you apart!', 195411, 0, 0, 1, 0, 0, 0, 0, 164542, 0, 0, 0, 0, 0, 0, 45114),
('', 'Poison fills the air...and your blood will fill your lungs!', 193138, 0, 0, 1, 0, 0, 0, 0, 166156, 0, 0, 0, 0, 0, 0, 45114),
('For the Margrave!', 'For the Margrave!', 189044, 0, 0, 0, 0, 0, 15, 149155, 149156, 0, 0, 0, 0, 0, 0, 45114),
('Another... soldier... falls...', 'Another... soldier... falls...', 189067, 0, 0, 0, 0, 0, 15, 149177, 149178, 0, 0, 0, 0, 0, 0, 45114),
('Antolyte. She could never defeat me in the arena. She will not defeat us here.', '', 195409, 0, 0, 1, 0, 0, 0, 165433, 0, 0, 0, 0, 0, 0, 0, 45114),
('', 'Mograine. The Maw will seem a fond memory when I am done with you.', 193829, 0, 0, 1, 0, 0, 0, 0, 164541, 0, 0, 0, 0, 0, 0, 45114),
('', 'We will choke the skies!', 193136, 0, 0, 1, 0, 0, 0, 0, 166162, 0, 0, 0, 0, 0, 0, 45114),
('So this... is defeat...', 'So this... is defeat...', 189105, 0, 0, 0, 0, 0, 15, 150153, 150154, 0, 0, 0, 0, 0, 0, 45114),
('Not... done... yet...', 'Not... done... yet...', 189101, 0, 0, 0, 0, 0, 15, 150145, 150146, 0, 0, 0, 0, 0, 0, 45114),
('My... final... battle...', 'My... final... battle...', 189099, 0, 0, 0, 0, 0, 15, 150141, 150142, 0, 0, 0, 0, 0, 0, 45114),
('', 'Clear the skies, Maldraxxi. I will meet you at the western landing when you are through.', 193102, 0, 0, 1, 0, 0, 0, 0, 164811, 0, 0, 0, 0, 0, 0, 45114),
('We will see it done, Paragon.', '', 193079, 0, 0, 66, 0, 0, 0, 165432, 0, 0, 0, 0, 0, 0, 0, 45114),
('', 'Your foul necromancers have enveloped the inner sanctum in a toxic cloud. I can only reach the entrance.', 193074, 0, 0, 1, 0, 0, 0, 0, 164809, 0, 0, 0, 0, 0, 0, 45114),
('', 'The monsters within are too powerful for you alone. Clear the skies for me...then their fate will rest in my hands.', 193081, 0, 0, 1, 0, 0, 0, 0, 164810, 0, 0, 0, 0, 0, 0, 45114),
('', 'Speak with me when you are ready to cross, Maldraxxi. Do not waste my time.', 193245, 0, 0, 1, 0, 0, 0, 0, 164830, 0, 0, 0, 0, 0, 0, 45114),
('We have secured the perimeter. Let us regroup with Paragon.', '', 192919, 0, 0, 66, 0, 0, 0, 165431, 0, 0, 0, 0, 0, 0, 0, 45114),
('', 'Face the wrath of Courage!', 193836, 0, 0, 0, 0, 0, 0, 0, 164833, 0, 0, 0, 0, 0, 0, 45114),
('The bulwark is up ahead... and its guard. It would be wise to invoke the Paragon.', '', 192917, 0, 0, 25, 0, 0, 0, 165428, 0, 0, 0, 0, 0, 0, 0, 45114),
('My... ascension...', 'My... ascension...', 189055, 0, 0, 0, 0, 0, 15, 149169, 149170, 0, 0, 0, 0, 0, 0, 45114),
('Face the power of necromancy!', 'Face the power of necromancy!', 189049, 0, 0, 0, 0, 0, 15, 149161, 149162, 0, 0, 0, 0, 0, 0, 45114),
('The war... goes on...', 'The war... goes on...', 189104, 0, 0, 0, 0, 0, 15, 150151, 150152, 0, 0, 0, 0, 0, 0, 45114),
('Break you to pieces!', 'Break you to pieces!', 189010, 0, 0, 0, 0, 0, 15, 150057, 150058, 0, 0, 0, 0, 0, 0, 45114),
('I will end you!', 'I will end you!', 189089, 0, 0, 0, 0, 0, 15, 150131, 150132, 0, 0, 0, 0, 0, 0, 45114),
('For eternal glory!', 'For eternal glory!', 189095, 0, 0, 0, 0, 0, 15, 150135, 150136, 0, 0, 0, 0, 0, 0, 45114),
('', 'I will break all of you!', 193838, 0, 0, 0, 0, 0, 0, 0, 164835, 0, 0, 0, 0, 0, 0, 45114),
('Time to earn my glory!', 'Time to earn my glory!', 190960, 0, 0, 0, 0, 0, 15, 152392, 152393, 0, 0, 0, 0, 0, 0, 45114),
('The Primus... has... left us...', 'The Primus... has... left us...', 189072, 0, 0, 0, 0, 0, 15, 149181, 149182, 0, 0, 0, 0, 0, 0, 45114),
('', 'My vengeance upon you!', 193835, 0, 0, 0, 0, 0, 0, 0, 164832, 0, 0, 0, 0, 0, 0, 45114),
('', 'We will not be pushed out! Maldraxxus will hold!', 192791, 0, 0, 15, 0, 0, 0, 0, 153195, 0, 0, 0, 0, 0, 0, 45114),
('An ambush! Cut them down!', '', 192906, 0, 0, 5, 0, 0, 0, 165430, 0, 0, 0, 0, 0, 0, 0, 45114),
('The bulwark is unguarded? Stay vigilant...', '', 192908, 0, 0, 25, 0, 0, 0, 165429, 0, 0, 0, 0, 0, 0, 0, 45114);
